About: The All-American Treat! In Snack Time you'll meet Sandy Reed, a foxy, young delivery girl who likes TV, sex and snackin'. The guys at her next stop share the exact same interest and they invite her to break for lunch and watch some adult videotapes. It's not long until Sandy sets down her chips to snack on something more substantial. Soon she's munching on both of her well-hung friends! But this is just the beginning. Carrie Stevens demonstrates her gourmet oral expertise, Michele Douglas proves she &quot;can't eat just one&quot; and Janine South lets you &quot;have it your way&quot; in this non-stop smorgasbord of sexual feasting. But don't forget Sandy Reed; she has some outrageous erotic goodies in store for you! So if you're tired of the same place and the same thing try Snack Time. It's a tasty treat sure to satisfy your appetite for fantastic sexual snackin'!
